short_desc:
Kích thước 22 x 27 cm
 Chất liệu vải cotton và bông cao cấp;
 Họa tiết và màu sắc dễ thương;
 Giúp bé ngủ ngon, tránh méo đầu hiệu quả.

Đầu đĩa 3D Bluray cho hình ảnh sắc nét và hiệu ứng sống động;
 - Công suất 500W (RMS);
 - Thiết kế thanh sang trọng phù hợp nhiều không gian;
 - Ấn tượng với vẻ ngoài thời trang và hiện đại;
 - Giải mã nhiều định dạng cho bạn trải nghiệm nhiều định dạng âm thanh từ nguồn phát;
 - Hỗ trợ kết nỗi TV thông minh mang đến nội dung phong phú và đa dạng.
